var socket = io("http://lochat-lorenzopicoli.rhcloud.com:8000");
// var socket = io("192.168.25.6:1337");
var isWindowFocused = true;
var $messages = $("#messagesBox");

function askNotificationPermission(){
    var Notification = window.Notification || window.mozNotification || window.webkitNotification;

    Notification.requestPermission(function (permission) {
        socket.emit("permission-asked");
    });
}


function showNotification(title, message) {
    var instance = new Notification(
        title, {
            body: message,
            icon: "data:image/png;base64,"
        }
    );

    instance.onclick = function () {
        window.focus();
        //TODO: Cancel
        this.cancel();
    };
}
socket.on("message", function(message){
    printMessage(message);
    if(!isWindowFocused){
        //Remember to slice the message to remove the <i>HH:mm</i>
        showNotification("New message on LoChat", message.user.name + ": " + message.text);
    }
    scrollMessagesToBottom();
});

socket.on("statusUpdate", function(messagesSent, users){
	$("#message-stats").text(messagesSent + " messages sent.");
	$("#users-stats").text(users.length + " users online.");
	$("#onlineBox").empty();

	users.unshift({name: "LoChat"});
	users.forEach(function(user){
		var p = $("<p>");
		p.append(user.name + " ");
		var span = $("<span>");
		span.attr("class", "label label-success");
		span.append('On');
		p.append(span);
		$("#onlineBox").append(p);

	});
});

socket.on("connect", function(){
    setTitle("Connected to LoChat");
    askNotificationPermission();
});

socket.on("disconnect", function(){
    setTitle("You are offline");
});

socket.on("refused", function(message){
    alert(message);
});

$(window).on("blur focus", function(e) {
    var prevType = $(this).data("prevType");

    if (prevType != e.type) { 
        switch (e.type) {
            case "blur":
                isWindowFocused = false;
                break;
            case "focus":
                isWindowFocused = true;
                break;
        }
    }

    $(this).data("prevType", e.type);
});

$(window).on("beforeunload", function() {
	socket.emit("disconnect");
	socket.disconnect();
});

$('#newMessageBox').on('keypress', function(e) {
    if (e.which == 13 && ! e.shiftKey) {
		var input = $('#newMessageBox');
        if(input.val() === "/connect"){
            socket.connect();
        }else{
        	
        	socket.emit("newMessage", input.val());
        }

        input.val('');
        e.preventDefault();
        e.stopPropagation();
        return false;
    }
});

$("#sendBtn").on("click", function(){
	var input = $('#newMessageBox');
      if(input.val() === "/connect"){
         socket.connect();
         socket.emit("askStatusUpdate");
      }else{
      	socket.emit("newMessage", input.val());
     }

     input.val('');
});

function scrollMessagesToBottom(){
    $messages.scrollTop($messages.height() + $messages[0].scrollHeight );
}

function setTitle(title) {
    $("#statusLabel").text(title);
}

function printMessage(message) {
	//Make the time font style italic
	//Scape characters to protect against some types of XSS
    var p = $("<p>");
    var i = $('<i>');
    var b = $('<b>');
    var text = " - " + message.text;
    var username = " " + message.user.name;
    var time = message.time;
   	i.append(time);
   	i.attr("style", 'font-size: 0.8em;');
   	b.append(username);
   	p.append(i);
   	p.append(b);
   	// p.append(text);
   	p.html(time + username + ": " +  message.text);
    $("#messagesBox").append(p);
}
